import React, { useState } from 'react';
import { FaBalanceScaleLeft, FaBalanceScaleRight, FaChartLine, FaBoxes, FaShoppingCart, FaExchangeAlt, FaSignOutAlt } from 'react-icons/fa';

const Dashboard = ({ metrics, onNetMovementClick }) => (
  <div className="dashboard">
    <div className="card">
      <h3><FaBalanceScaleLeft /> Opening Balance</h3>
      <p>{metrics.openingBalance}</p>
    </div>
    <div className="card">
      <h3><FaBalanceScaleRight /> Closing Balance</h3>
      <p>{metrics.closingBalance}</p>
    </div>
    <div className="card clickable" onClick={onNetMovementClick} title="Click for details">
      <h3><FaChartLine /> Net Movement</h3>
      <p>{metrics.netMovement}</p>
    </div>
    <div className="card">
      <h3><FaBoxes /> Assigned Assets</h3>
      <p>{metrics.assigned}</p>
    </div>
    <div className="card">
      <h3><FaSignOutAlt /> Expended Assets</h3>
      <p>{metrics.expended}</p>
    </div>
  </div>
);

const Filters = ({ filters, setFilters }) => {
  const handleChange = (e) => setFilters({ ...filters, [e.target.name]: e.target.value });

  return (
    <div className="filters">
      <input
        type="date"
        name="date"
        value={filters.date}
        onChange={handleChange}
        placeholder="Select Date"
      />
      <input
        type="text"
        name="base"
        value={filters.base}
        onChange={handleChange}
        placeholder="Base"
      />
      <input
        type="text"
        name="equipment"
        value={filters.equipment}
        onChange={handleChange}
        placeholder="Equipment Type"
      />
    </div>
  );
};

const Modal = ({ details, onClose }) => (
  <div className="modal-overlay" onClick={onClose}>
    <div className="modal" onClick={(e) => e.stopPropagation()}>
      <h2>Net Movement Details</h2>
      <ul>
        <li><FaShoppingCart /> Purchases: {details.purchases}</li>
        <li><FaExchangeAlt /> Transfer In: {details.transferIn}</li>
        <li><FaExchangeAlt /> Transfer Out: {details.transferOut}</li>
      </ul>
      <button onClick={onClose}>Close</button>
    </div>
  </div>
);

export default function App() {
  const [filters, setFilters] = useState({ date: '', base: '', equipment: '' });
  const [showModal, setShowModal] = useState(false);

  const metrics = {
    openingBalance: 1500,
    closingBalance: 1250,
    netMovement: 300,
    assigned: 420,
    expended: 120,
  };

  const netMovementDetails = {
    purchases: 500,
    transferIn: 200,
    transferOut: 400,
  };

  return (
    <div className="App">
      <h1 className="title">Asset Dashboard</h1>
      <Filters filters={filters} setFilters={setFilters} />
      <Dashboard metrics={metrics} onNetMovementClick={() => setShowModal(true)} />
      {showModal && <Modal details={netMovementDetails} onClose={() => setShowModal(false)} />}
    </div>
  );
}
